import React, { Component } from 'react'

export default class Events extends Component {
  render() {
    const mystyle = {
      // padding: "10px",
      // fontFamily: "Arial"
    };
    return (
      <div>
        <div className="row">
          <div className="col-lg-6 mx-4 px-4" style={mystyle}>
            <div className="card" >
              <div className="card-body">
                <h5 className="card-title">Summer Course Starts </h5>
                <h6 className="card-subtitle mb-2 text-muted">April 25, 2020</h6>
                <p className="card-text">Lorem ipsum dolor sit amet consectetur adipisicing elit architecto.</p>
              </div>
            </div>
          </div> {/* end of col */}

          <div className="col-lg-6">
            <img src="" alt="" />
            {/* end of col */}
          </div>
        </div>
      </div>
    )
  }
}
